package letteravatar

import (
	"bytes"
	"compress/gzip"
	"io"

	"github.com/golang/freetype/truetype"
)

var defaultFont *truetype.Font

func init() {
	gz, err := gzip.NewReader(bytes.NewBuffer(fontData))
	if err != nil {
		panic(err)
	}
	defer gz.Close()

	var buf bytes.Buffer
	io.Copy(&buf, gz)
	if err != nil {
		panic(err)
	}

	defaultFont, err = truetype.Parse(buf.Bytes())
	if err != nil {
		panic(err)
	}
}

